import React from 'react';
import {Container, Row, Col, ToggleButtonGroup, ToggleButton} from 'react-bootstrap'

import Review from './Reviews'
import Schedule from './Schedule'
import Features from './Features'

function App() {

  const changeViews = (e) =>{
    value = e.value;
    if (value == 1){
      return (<Features/>);
    }else if (value == 2){
      return (<Schedule/>);
    }else if (value == 3){
      return (<Review/>);
    }
  }

  return (
    <div className="App">
      <ToggleButtonGroup type="radio" name="menu" defaultValue={1} onChange="changeViews">
        <ToggleButton value={1}>Home</ToggleButton>
        <ToggleButton value={2}>Schedule</ToggleButton>
        <ToggleButton value={3}>Reviews</ToggleButton>
      </ToggleButtonGroup>
      <br/>
      <Container>
        <Row>
          <Col>
            <changeViews/>
          </Col>
        </Row>
      </Container>

    </div>
  );
}

export default App;
